import React, {useEffect, useState} from 'react';
import { Helmet } from 'react-helmet';
import axios from 'axios';
import { Link } from 'react-router-dom';

interface Listing{
  title: string;
  photo_main: string;
  city: string;
  state: string;
  zipcode: string;
  home_type: string;
  price: number; // Assuming price is a number
  bedrooms: number; // Assuming bedrooms is a number
  bathrooms: number; // Assuming bathrooms is a number
  sqft: number; // Assuming sqft is a number
  description: string;
  realtor: string; // Assuming this is an ID or key to fetch realtor details
  [key: string]: any; 
}
interface Realtor {
  name: string;
  photo: string;
  phone: string;
  email: string;
  description: string;
  // Add other fields as necessary
}



interface ListingDetailProps {
  match: {
    params: {
      id: string;
    };
  };
}

const ListingDetail: React.FC<ListingDetailProps> = ({match}) => {

  const [listing, setListing] = useState({});
  const [realtor, setRealtor] = useState({});
  const [price, setPrice] = useState({});

  const numberWithCommas = (x:string) => {
    return x.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ',');
  }

  useEffect(()=> {
    const {id} = match.params;
    const config = {
      headers: {
        'Authorization': `Bearer ${localStorage.getItem('token')}`
      }
    };

    axios.get(`http://localhost:8001/api/listings/${slug}`, config)
    .then(res => {
      setListing(res.data);
      setPrice(numberWithCommas(res.data.price))
    })
    .catch(err=> {

    });

  }, [match.params.id])

  useEffect(()=> {
    const id = listing.realtor;
    const config = {
      headers: {
        'Authorization': `Bearer ${localStorage.getItem('token')}`
      }
    };
    if (id){
      axios.get(`http://localhost:8001/api/realtors/${id}`, config)
      .then(res => {
        setRealtor(res.data);
      })
      .catch(err => {

      });
    }
  }, [listing.realtor]);

  const displyInteriorImages = () => {
    let images = [];
    images.push(
      <div key={1} className='row'>
        <div className='col-1-of-3'>
          {listing.photo_1? (
            <div className='listingdetail__display'>
              <img className='listingdetail__display__image' src={listing.photo_1} alt="" />
            </div>
          ) : null}
        </div>
        <div className='col-1-of-3'>
          {listing.photo_2? (
            <div className='listingdetail__display'>
              <img className='listingdetail__display__image' src={listing.photo_2} alt="" />
            </div>
          ) : null}
        </div>
        <div className='col-1-of-3'>
          {listing.photo_3? (
            <div className='listingdetail__display'>
              <img className='listingdetail__display__image' src={listing.photo_3} alt="" />
            </div>
          ) : null}
        </div>
        <div className='col-1-of-3'>
          {listing.photo_4? (
            <div className='listingdetail__display'>
              <img className='listingdetail__display__image' src={listing.photo_4} alt="" />
            </div>
          ) : null}
        </div>
        <div className='col-1-of-3'>
          {listing.photo_5? (
            <div className='listingdetail__display'>
              <img className='listingdetail__display__image' src={listing.photo_5} alt="" />
            </div>
          ) : null}
        </div>
        <div className='col-1-of-3'>
          {listing.photo_6? (
            <div className='listingdetail__display'>
              <img className='listingdetail__display__image' src={listing.photo_6} alt="" />
            </div>
          ) : null}
        </div>
        <div className='col-1-of-3'>
          {listing.photo_7? (
            <div className='listingdetail__display'>
              <img className='listingdetail__display__image' src={listing.photo_7} alt="" />
            </div>
          ) : null}
        </div>
        <div className='col-1-of-3'>
          {listing.photo_8? (
            <div className='listingdetail__display'>
              <img className='listingdetail__display__image' src={listing.photo_8} alt="" />
            </div>
          ) : null}
        </div>
        <div className='col-1-of-3'>
          {listing.photo_9? (
            <div className='listingdetail__display'>
              <img className='listingdetail__display__image' src={listing.photo_9} alt="" />
            </div>
          ) : null}
        </div>
        <div className='col-1-of-3'>
          {listing.photo_10? (
            <div className='listingdetail__display'>
              <img className='listingdetail__display__image' src={listing.photo_10} alt="" />
            </div>
          ) : null}
        </div>
      </div>
    );
    return images;
  }
  return (
    <div className='listingdetail'>
      <Helmet>
        <title>Real Estate - Listing | {`${listing.title}`}</title>
        <meta name='description' content='Listing detail' />
      </Helmet>
      <div className='listingdetail__header'>
        <h1 className='listingdetail__title'>
          {listing.title}
        </h1>
        <p className='listingdetail__location'>{listing.city}, {listing.state}, {listing.zipcode}</p>
      </div>
      <div className='row'>
        <div className='listingdetail__breadcrumb'>
          <Link className='listingdetail__breadcrumb__link' to='/'>Home</Link> {listing.title}
        </div>
      </div>
      <div className='row'>
        <div className='col-3-of-4'>
          <div className='listingdetail__display'>
            <img className='listingdetail__display__image' src={listing.photo_main} alt=''/>
          </div>
        </div>
        <div className='col-1-of-4'>
          <div className='listingdetail__display'>
            <img className='listingdetail__display__image' src={realtor.photo} alt=''/>
          </div>
          <h3 className='listingdetail__realtor'>{realtor.name}</h3>
          <p className='listingdetail__realtor'>{realtor.phone}</p>
          <p className='listingdetail__realtor'>{realtor.email}</p>
